import React, { useEffect, useState } from "react";
import axios from "axios";
import { FaCircle } from "react-icons/fa";
import { useNavigate } from "react-router-dom";
import { BASE_URL } from './constants';

const Employee = () => {
  const [employees, setEmployees] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const fetchEmployees = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await axios.get(`${BASE_URL}/employees`);
      setEmployees(response.data);
    } catch (err) {
      setError("Error fetching employees. Please try again later.");
      console.error("Error fetching employees:", err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchEmployees();
  }, []);

  const retryFetch = () => {
    setError(null);
    fetchEmployees();
  };

  const goToDetails = (path, employeeId) => {
    navigate(`/employees/${employeeId}/${path}`);
  };

  const EmployeeRow = ({ employee, index }) => (
    <tr key={employee._id} className="hover:bg-gray-100 transition-colors duration-200">
      <td className="border border-gray-300 px-2 py-4 sm:px-4">{index + 1}</td>
      <td className="border border-gray-300 px-2 py-4 sm:px-4">{employee.employeeId}</td>
      <td className="border border-gray-300 px-2 py-4 sm:px-4">{employee.name}</td>
      <td className="border border-gray-300 px-2 py-4 sm:px-4">{employee.mobileNumber}</td>
      <td className="border border-gray-300 px-2 py-4 space-y-2 sm:space-y-0 sm:space-x-2 sm:flex sm:flex-row">
        {['call-logs', 'messages', 'attendance-list'].map((path, idx) => (
          <button
            key={idx}
            onClick={() => goToDetails(path, employee.employeeId)}
            className={`w-full sm:w-auto font-bold py-2 px-4 rounded text-white ${idx === 0 ? "bg-blue-500 hover:bg-blue-700" : idx === 1 ? "bg-green-500 hover:bg-green-700" : "bg-yellow-500 hover:bg-yellow-700"}`}
            aria-label={`View ${path.replace('-', ' ')}`}
          >
            {path.replace('-', ' ').charAt(0).toUpperCase() + path.replace('-', ' ').slice(1)}
          </button>
        ))}
      </td>
      <td className="border border-gray-300 px-2 py-4 flex items-center justify-center sm:justify-start">
        <FaCircle className={`mr-2 ${employee.isActive ? "text-green-500" : "text-red-500"}`} />
        <span className="text-sm text-gray-700">{employee.isActive ? "Online" : "Offline"}</span>
      </td>
    </tr>
  );

  return (
    <div className="p-4 w-full max-w-5xl mx-auto mt-20 md:mt-24 lg:mt-20">
      <h2 className="text-2xl md:text-3xl font-bold mb-6 text-center">Employee List</h2>

      {loading ? (
        <div className="text-center text-gray-500">
          <p>Loading employees...</p>
        </div>
      ) : error ? (
        <div className="text-center text-red-500">
          <p>{error}</p>
          <button onClick={retryFetch} className="mt-4 bg-red-500 text-white px-4 py-2 rounded hover:bg-red-700">
            Retry
          </button>
        </div>
      ) : employees.length > 0 ? (
        <div className="overflow-x-auto">
          <table className="w-full bg-white border border-gray-300 rounded-lg shadow-md">
            <thead className="bg-gray-100">
              <tr>
                {["SL No", "Employee ID", "Employee Name", "Mobile Number", "Actions", "Active Status"].map((header, idx) => (
                  <th key={idx} className="border border-gray-300 px-2 py-3 text-left text-xs md:text-sm font-medium text-gray-600">
                    {header}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {employees.map((employee, index) => (
                <EmployeeRow key={employee._id} employee={employee} index={index} />
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <div className="text-center text-gray-500">
          <p>No employees available.</p>
        </div>
      )}
    </div>
  );
};

export default Employee;
